import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import Page from '../../components/page/Page';
import CustomBuiltForm from '../../components/form/CustomBuiltForm';
import plusIcon from '../../imgs/icons/plusIcon.png';
import { setCompanyTab } from '../../redux/actions/session';

const AddCompany = ({
    // getCompanies,
    currentCompanyTab: currentTab = 'details',
    setCompanyTab: setCurrentTab,
}) => {
    const formData = {
        details: [],
        http: '/api/profile/',
        url: '/dashboard/profile',
        cb: null,
        msg: 'A new company has been created successfully.',
    };

    return (
        <Page title='Add Company Form.'>
            <div className='tile tile--info'>
                <img src={plusIcon} alt='' className='icon--md' />{' '}
                <h2>Please create a new company.</h2>
            </div>
            <CustomBuiltForm data={formData} />
        </Page>
    );
};

AddCompany.propTypes = {
    profile: PropTypes.object,
    getProfile: PropTypes.func,
    setCurrentprofileTab: PropTypes.func,
};
const mapStateToProps = (state) => ({
    currentCompanyTab: state.session.currentCompanyTab,
});
const mapDispatchToProps = {
    setCompanyTab,
};
export default connect(mapStateToProps, mapDispatchToProps)(AddCompany);
